import './App.css';

function App() {
  return (
    <main>
      <header>
        <a href="/" className="logo">MYblog</a>
        <nav>
          <a href="/login">Login</a>
          <a href="/register">Register</a>
        </nav>
      </header>
      <div className="entry">
        <img src="" alt="" />
      </div>
    </main>
  );
}

export default App;
